import React from "react";

const Frontend = () => {
    return (
        <div className="skills_content">
            <h3 className="skills_title"></h3>

            <div className="skills_box">
                <div className="skills_group">
                    <div className="skills_data"></div>
                </div>
            </div>
        </div>
    )
}

export default Frontend
